int main( const int argc, const char** argv )
{
    //const std::string file_for_mag_outlog = "out/mag_out.log";
    //const std::string file_for_wifi_outlog = "out/wifi_out.log";
    //const std::string file_for_ble_outlog = "out/ble_out.log";
    //const std::string file_for_mixed_outlog = "out/mixed_out.log";
    const std::string file_for_mag_outlog = "out/pos_out_for_tpn_in.log";


    Fppe::FPEngine *fpEngine = new  Fppe::FPEngine();

    std::string arg;
    //std::stringstream ss;
    std::string name;
    double mag_grid_size = 1;
    bool   magEnable = true;
    bool   wifiEnable = false;
    bool   bleEnable = false;

    bool success = true;

    Venue venue;
    // venue parameters
    venue.id = 1;
    venue.size_x = 142;
    venue.size_y = 110;
    venue.floors_count = 1;
    // venue frame parameters
    venue.origin_lattitude = 37.303872359106229 ; // [-90;90]
    venue.origin_longitude = -121.865964103907100; // [-180;180]
    venue.origin_azimuth = -49.533150237103442;     // [-180;180]
    venue.origin_altitude = 0;
    venue.alfa = 0;   // 0 - for default scaling
    venue.beta = 0;   // 0 - for default scaling

    Fppe::ReturnStatus status = fpEngine->setVenueParams( venue );

    std::string fp_magnetic_base_file = "fp/target_sj.mfp3";

    struct stat file_buf;
    stat( fp_magnetic_base_file.c_str(), &file_buf );
    size_t mfpMapSizeInBytes = file_buf.st_size;
    char *pMfpMap = ( char * )malloc( mfpMapSizeInBytes );

    FILE *pF = fopen( fp_magnetic_base_file.c_str(), "rb" );
    _ASSERT( pF );

    fread( pMfpMap, mfpMapSizeInBytes, 1, pF );
    fclose( pF );

    status = fpEngine->initializeMFP( pMfpMap, mfpMapSizeInBytes, venue.size_x, venue.size_y, mag_grid_size, 0, venue.floors_count - 1 );

    Fppe::MagneticCalibrationParam bias_cov;
    std::string mag_bias_file = "fp/default.mbias";
    // reading magnetic bias from file
    {

        std::string line;
        const char delim = ',';

        std::ifstream inputStream;

        inputStream.open( mag_bias_file );

        if ( inputStream.fail() )
        {
            inputStream.close();
            status = Fppe::ReturnStatus::STATUS_UNKNOWN_ERROR;
        }
        else
        {
            inputStream >> bias_cov.timestamp;
            inputStream >> bias_cov.mX;
            inputStream >> bias_cov.mY;
            inputStream >> bias_cov.mZ;

            memset( bias_cov.covarianceMatrix, 0, sizeof( bias_cov.covarianceMatrix ) );

            inputStream >> bias_cov.covarianceMatrix[0][0];
            inputStream >> bias_cov.covarianceMatrix[1][1];
            inputStream >> bias_cov.covarianceMatrix[2][2];

            inputStream.close();

            status = Fppe::ReturnStatus::STATUS_SUCCESS;
        }

    }

    //if ( status == Fppe::ReturnStatus::STATUS_SUCCESS )
    //    fpEngine->setMagneticBias( bias_cov );

    fpEngine->setUpdateMFP( magEnable ); /**< updater MFP control */
    fpEngine->setUpdateWiFi( wifiEnable ); /**< updater WiFi control */
    fpEngine->setUpdateBLE( bleEnable ); /**< updater Ble control */


    //Fppe::MagneticVector mag_vector;
    //Fppe::WiFiScanResult wifi_scan_result;
    //Fppe::BleScanResult ble_scan_result;

    // callback for writing the position into file
    Fppe::IPositionUpdate *pPosMagCbk;

    try
    {
        pPosMagCbk = new PositionUpdate( file_for_mag_outlog ); //exception if file was not opened
    }
    catch ( ... )
    {
        pPosMagCbk = NULL;
        status = Fppe::ReturnStatus::STATUS_UNKNOWN_ERROR;
    }

    fpEngine->setPositionCallbackMFP( pPosMagCbk );

    std::ofstream pf_log("pf_log.txt", std::ios::out);
    fpEngine->setLogStream(0, pf_log);
    // Main cycle
    {
        TpnOutput tpnOut;

        int count = sizeof( tpn_data ) / sizeof( tpnOut );
        int i = 0;

        while ( i < count )
        {
            //FPc.getInputWiFiData( wifi_scan_result );
            //FPc.processInputWiFiData( wifi_scan_result );

            //FPc.getInputBleData( ble_scan_result );
            //FPc.processInputBleData( ble_scan_result );

            tpnOut = tpn_data[i];

            fpEngine->processTpnOutput( tpnOut );
            i++;
        }
    }

    fpEngine->getMagneticBias( &bias_cov );

    // writing magnetic bias to file
    {
        std::ofstream outputStream;
        outputStream.open( mag_bias_file );

        if ( outputStream.fail() )
        {
            outputStream.close();
            status = Fppe::ReturnStatus::STATUS_UNKNOWN_ERROR;
        }
        else
        {
            outputStream << bias_cov.timestamp << std::endl;
            outputStream << bias_cov.mX << std::endl;
            outputStream << bias_cov.mY << std::endl;
            outputStream << bias_cov.mZ << std::endl;

            outputStream << bias_cov.covarianceMatrix[0][0] << std::endl;
            outputStream << bias_cov.covarianceMatrix[1][1] << std::endl;
            outputStream << bias_cov.covarianceMatrix[2][2] << std::endl;

            outputStream.close();

            status = Fppe::ReturnStatus::STATUS_SUCCESS;
        }
    }
    
    delete fpEngine;
    pf_log.close();
    return 0;
}
